  "<ul><li>Spider Form is most effective at finishing off enemies with low health; Human Form's Neurotoxin does more damage to healthy foes. <li>When in Spider Form, Spiderlings will attack the target that Elise uses Venomous Bite on. <li>Elise's Spider Form and Spider Form abilities do not cost mana and can be prioritized when you are trying to conserve mana.</ul>": 1,
  "<postScriptLeft>Small Shark Damage<br>Medium Shark Damage<br>Big Shark Damage<br>Cooldown</postScriptLeft>": 1,
