  "<ul><li>Avoid bunching up with other allies when Amumu has his ultimate available.<li>Erratic movement, or hiding behind creep waves can make it difficult for Amumu to instigate a fight with Bandage Toss.<li>Amumu's Despair makes purchasing primarily Health items a risky proposition.</ul>": 1,
