  "<ul><li>Using Divine Judgment on a high-DPS ally can turn the tides of battle by giving your ally free reign to attack. <li>Kayle's attacks become incredibly powerful once she gains attack range from Divine Ascent. Play safe until then. <li>Kayle benefits greatly from Attack Damage and Ability Power, making hybrid items like Nashor's Tooth and Hextech Gunblade very effective on her.</ul>": 1,
  "<postScriptRight>[ @BaseDamage1Prefix@@BaseDamage1@@BaseDamage1Postfix@ / @BaseDamage2Prefix@@BaseDamage2@@BaseDamage2Postfix@ / @BaseDamage3Prefix@@BaseDamage3@@BaseDamage3Postfix@ / @BaseDamage4Prefix@@BaseDamage4@@BaseDamage4Postfix@ / @BaseDamage5Prefix@@BaseDamage5@@BaseDamage5Postfix@ ]<br>[ @RootDuration1Prefix@@RootDuration1@@RootDuration1Postfix@ / @RootDuration2Prefix@@RootDuration2@@RootDuration2Postfix@ / @RootDuration3Prefix@@RootDuration3@@RootDuration3Postfix@ / @RootDuration4Prefix@@RootDuration4@@RootDuration4Postfix@ / @RootDuration5Prefix@@RootDuration5@@RootDuration5Postfix@ ]<br>[ @Cost1Prefix@@Cost1@@Cost1Postfix@ / @Cost2Prefix@@Cost2@@Cost2Postfix@ / @Cost3Prefix@@Cost3@@Cost3Postfix@ / @Cost4Prefix@@Cost4@@Cost4Postfix@ / @Cost5Prefix@@Cost5@@Cost5Postfix@ ]</postScriptRight>": 4,
  "<ul><li>Olaf becomes more dangerous the lower life he is. Save your disables to finish him off.<li>Preventing Olaf from reaching his axe will minimize the amount of harassment he can cause in the laning phase.<li>Olaf has reduced defenses from damage during Ragnarok, despite being immune to disables. If you can't escape from Olaf during Ragnarok, try focusing your damage on him with your teammates.</ul>": 1,
  "<titleLeft>Doran's Blade</titleLeft>": 3,
  "<subtitleLeft>+@FlatPhysicalDamageMod@ Attack Damage<br>+@FlatHPPoolMod@ Health<br>+@PercentLifeStealMod*100@% Life Steal</subtitleLeft>": 2,
  "<ul><li>A fully charged Vault Breaker will deal double damage. It's great for catching and finishing off fleeing enemies.<li>Relentless Force does full damage to anyone caught in the shockwave. Use it on minions in lane to hit enemies hiding behind them.<li>Cease and Desist is a powerful initiation tool, just remember not to get too far ahead of the rest of your team.</ul>": 1,
