  "<ul><li>Xerath's range can be intimidating, but most champions who close distance with him can trade favorably.<li>Xerath takes a long time to engage Rite of the Arcane. Watch for his spellcast animation and start dodging.<li>Banshee's Veil will make it much harder for Xerath to land Shocking Orb on you.</ul>": 1,
  "<ul><li>Urgot relies heavily on blasting opponents with his legs, which have their own cooldowns and only detonate when he attacks in the direction they are facing. Avoid getting hit by multiple.<li>Urgot can deal and absorb tremendous amounts of damage with Purge, but slows himself while firing.<li>If you are struck by Fear Beyond Death, do your best to avoid falling below the execution threshold (25% of your Maximum Health) until the effect times out.</ul>": 1,
