  "<scaleLevel>Damage</scaleLevel>": 3,
  "<scaleBonus>@Haste@ Ability Haste</scaleBonus>": 2,
  "<mainText>Malzahar infects the mind of the closest unafflicted target, dealing @ModifiedDamage@ magic damage over @Duration@ seconds and reducing the Magic Resist of enemies by @MRShred*100@%.<br><br>If an afflicted target dies, Malefic Visions spreads to the nearest @SpreadTargets@ unafflicted targets with the remaining duration.</mainText>": 1,
