  "<titleLeft>Definitely Not Doom Blitzcrank</titleLeft>": 1,
  "<mainText>Doom Blitzcrank has powered up all his systems, giving him extra Rocket Grabs, a gigantic Mana Barrier and Static Field, and a Power Fist that knocks multiple enemies into the air. But it's definitely not him, so don't worry.</mainText>": 1,
  "<ul><li>Jinx's minigun takes time to ramp up. If you see her poking with rockets try to jump on her and burst her down.<li>Jinx's ultimate does less damage the closer you are to her.<li>Jinx's snare grenades have a long cooldown and are her primary means of protecting herself. If she misses with them she will have a hard time escaping if engaged upon. </ul>": 1,
  "<li>Bard's opponents can also travel through his Magical Journey doorways. You can follow him, if you think it's safe.</li>": 1,
  "<li>Bard's ultimate, Tempered Fate, affects allies, enemies, monsters, and turrets alike. Sometimes it can be to your advantage to jump into it!</li>": 1,
