  "<mainText>Aatrox sucks the soul of nearby enemies dealing @ModifiedSoulDamage@ magic damage and gaining @MaxHPIncrease@ maximum Health (@PercentMaxHealth*100@% of his max HP %i:scaleHealth%). He then unleashes his demonic form for the rest of combat, replacing his spell with The Darkin Blade.<br><br>The Darkin Blade: Aatrox leaps up and slams his greatsword down on his target, dealing @ModifiedDamage@ magic damage to all enemies hit and healing himself for @ModifiedHealing@ Health.</mainText>": 1,
