  "<ul><li>You can use Assassin's Path to get behind the enemy and set up for Noxian Diplomacy's melee attack.<li>Shadow Assault is a powerful escape tool, but can also be offensively used to assault a group.<li>Remember to pick your target before the fight. Focusing all of Talon's abilities on one target can be very rewarding, but splitting them up between many may leave you helpless.</ul>": 1,
