  "<ul><li>Zyra's seeds can be destroyed by stepping on them. If she tries to grow them as you do, dodge back at the last moment. <li>Moving closer to Zyra can be a smart move if she places plants too far away from herself.<li>Plants take fixed damage from attacks and effects, similar to wards. They also expire quickly on their own.<li>Moving the fight to a different area will deprive Zyra of accumulated seeds.<li>Seeds placed by Zyra's W are larger, a different color, and grant a small amount of vision to her team.</ul>": 1,
  "<ul><li>Picking up goo chunks is very important to staying alive.<li>When Cell Division is ready, try to die in a position that makes it difficult for the enemy team to kill your bloblets.<li>Charging Elastic Slingshot from the fog of war will give opponents less time to react.</ul>": 1,
