  "<expandRow>(@MinUnits@) @AP@% Spell Power</expandRow>": 1,
  "<ul><li>Offense is your defense. Keep fighting to build up larger Indestructible shields.<li>Hitting multiple champions with the same ability can help quickly activate Darkness Rise.<li>Use Realm of Death on a low health enemy to guarantee the kill and keep their stats for the rest of a teamfight.</ul>": 1,
  "<ul><li>Follow your Blood Hunt trails to low health enemy champions.<li>Infinite Duress (R)'s distance scales with any Move Speed you gain, even from ally buffs and summoner spells.<li>Jaws of the Beast (Q) will follow enemies who run, dash or teleport if you keep the button held down.</ul>": 1,
  "<keywordMajor>Buddy</keywordMajor>": 1,
