  "<kaText>ASSISTED BY</kaText>": 1,
  "<expandRow>(@MinUnits@) @BonusAD@ Attack Damage, @ProcChance@% chance</expandRow>": 1,
  "<ul><li>Use Bladesurge to cover great distances by targeting low life minions on your way to champion targets.<li>Defiant Dance is not interrupted by crowd control, try timing it for incoming disables.<li>Flawless Duet does not have a maximum travel distance, try using it in creative ways.</ul>": 1,
