  "<ul><li>For optimal burst, try to combine Relentless Pursuit into Piercing Light.<li>Ardent Blaze actually explodes in a star pattern. Try to line it up so the spokes hit enemy champions.<li>Once you have chosen an angle for The Culling, you cannot change it. Pick your moment well!<li>Because of Lightslinger, Lucian benefits more from Attack Damage than he does from Attack Speed.</ul>": 1,
